import React, {useEffect} from 'react'
import {modelFactory} from '../../ModelAction/modelUtil'
import {Category, CategoryItemInput} from '../../graphqlTypes/types'
import {useRouter} from 'next/router'
import {fpMergePre} from '../../tools/utils'
import {doc} from '../../graphqlTypes/doc'
import {useStoreModel} from '../../ModelAction/useStore'

export const productListModel = modelFactory('productListModel', {
  category: {} as Category,
}, {
  getCategory: async (value: CategoryItemInput, option) => {
    const res = await option.query(doc.oneCategory, {data: value})
    option.setData(fpMergePre({
      category: res?.oneCategory ?? {},
    }))
  },
  getData: async (value, option) => {
  },

})

export const ProductList = () => {
  const router = useRouter()
  const id = (router.query?.id as string) ?? ''
  const {actions: actionsPLM} = useStoreModel(productListModel)

  useEffect(() => {
    if (!!id) {
      actionsPLM.getCategory()
    }
  }, [id])

  return <div>
    productList
  </div>
}
